import React from "react";
import  { Popover, Button } from "antd"

const Navbar9 = () => {
    return(
        <>
  <template>
  <a-popover title="Title">
    <template content>
      <p>Content</p>
      <p>Content</p>
    </template>
    <a-button type="primary">Hover me</a-button>
  </a-popover>
</template>
        </>
    )
}
 export default Navbar9;
